import React from 'react';
import logo from './logo.svg';
import './App.css';

const Add = props => <h1>{props.a + props.b}</h1>

const Layout = props => (
  <div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Examples
          <Add a={2} b={3}/>
        </p>
      </header>
      <main>
        {props.children}
      </main>
      <footer>My Footer</footer>
  </div>
);

function App() {
  return (
    <Layout>
      <p>Page1</p>
    </Layout>
  );
}

export default App;
